import { CardGroup, Card, Image, Button, Carousel, Container, Row, Col } from 'react-bootstrap';
import ScrollAnimation from 'react-animate-on-scroll';
import React from 'react'
import ReactPlayer from 'react-player'


const Index = () => (
  <Layout>
    <title>The History of BfBB</title>
    <ScrollAnimation animateIn="fadeInLeft" animateOnce="true" offset="50" delay="500">
    <div style={{width:'100%',paddingLeft:'10%',paddingRight:'10%',height:'45vw'}}>
        <iframe width="100%" height="100%" src="https://www.youtube.com/embed/videoseries?list=PLDzuZShnnVbZ78eM3wnnXq1C3mnU2PMZf" frameborder="0" allow="autoplay; encrypted-media" allowfullscreen></iframe>
    </div>
    </ScrollAnimation>

  </Layout>
);

export default Index;
